    #             maxCounter = counter
    #         i += 1
    #     elif nums[i] == 0 and zeroActivated == False:
    #         zeroActivated =True
    #         zeroIndex = i
    #         counter += 1
    #         if i == len(nums)-1 and maxCounter < counter:
    #             maxCounter = counter
    #         i+=1
    #     elif nums[i] == 0 and zeroActivated == True:
    #         zeroActivated = False
    #         i = zeroIndex + 1
    #         if maxCounter < counter:
    #             maxCounter = counter
    #             counter = 0
    #         continue
    # return maxCounter

    ## Leetcode solution
    longest_sequence = 0
    for left in range(len(nums)):
        num_zeroes = 0
        for right in range(left, len(nums)):   # check every consecutive sequence
            if num_zeroes == 2:
                break
            if nums[right] == 0:               # count how many 0's
                num_zeroes += 1
            if num_zeroes <= 1:                 # update answer if it's valid
                longest_sequence = max(longest_sequence, right - left + 1)
    return longest_sequence

